function Install-WinPCap 
{
      <#
        .SYNOPSIS
    
            Manually install the WinPCAP libraries/driver
            Author: @sixdub

        .DESCRIPTION

            Requires admin. Drops all required files and creates a service to install the WinPCAP drivers. WinPCAP is licensed and copyrighted as follows:
            #Copyright (c) 1999 - 2005 NetGroup, Politecnico di Torino (Italy).
            #Copyright (c) 2005 - 2010 CACE Technologies, Davis (California).
            #All rights reserved.
            #For the full winpcap license, please see the repo

    #>
    
    [cmdletbinding()]
    Param()
    Write-Verbose "Checking if admin..."
    If (-NOT ([Security.Principal.WindowsPrincipal] [Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole(`
    [Security.Principal.WindowsBuiltInRole] “Administrator”))
    {
        Throw "This script requires administrator rights"
    }
    
    #Copyright (c) 1999 - 2005 NetGroup, Politecnico di Torino (Italy).
    #Copyright (c) 2005 - 2010 CACE Technologies, Davis (California).
    #All rights reserved.
    #For the full winpcap license, please see the repo
    
    Write-Verbose "Loading libraries in memory"
    #Fill these in with the binaries from a winpcap installation. For more info, see my writeup.
    $packetdll_x64 = ""
    $packetdll_x86 = ""
    $wpcapdll_x64 = ""
    $wpcapdll_x86 = ""
    $npfsys_x64 = ""
    $npfsys_x86 = ""

    $packetdll = ""
    $wpcapdll = ""
    $npfsys = ""
    $SysPath =""
    #Determine Arch of the system
    $Arch = (Get-WmiObject Win32_OperatingSystem).OSArchitecture
    
    if($arch -like "*64*")
    {
        if([IntPtr]::Size -eq 8)
        {
            Write-Verbose "Detected 64 bit PowerShell"
            $SysPath = "c:\windows\system32"
        }
        elseif([IntPtr]::Size -eq 4)
        {
            Write-Verbose "Detected 32 bit PowerShell"
            $SysPath = "c:\windows\sysnative"
        }
        else
        {
            Throw "Arch detection is very broken"
        }
        Write-Verbose "Detected 64 bit system"
        $packetdll = $packetdll_x64
        $wpcapdll = $wpcapdll_x64
        $npfsys = $npfsys_x64
    }
    elseif($arch -like "*32*")
    {
        $SysPath = "c:\windows\system32"
        Write-Verbose "Detected 32 bit system"
        $packetdll = $packetdll_x86
        $wpcapdll = $wpcapdll_x86
        $npfsys = $npfsys_x86
    }
    else
    {
        Throw "Version detection problem"
    }

    Write-Verbose "Writing required files to disk for install with System Path: $SysPath"
    #Drop them to their proper locations on disk
    $packetdll_drop = [System.Convert]::FromBase64String($packetdll)
    [System.IO.File]::WriteAllBytes("$SysPath\packet.dll",$packetdll_drop)

    $wpcapdll_drop = [System.Convert]::FromBase64String($wpcapdll)
    [System.IO.File]::WriteAllBytes("$SysPath\wpcap.dll",$wpcapdll_drop)

    $npfsys_drop = [System.Convert]::FromBase64String($npfsys)
    [System.IO.File]::WriteAllBytes("$SysPath\drivers\npf.sys",$npfsys_drop)

    Write-Verbose "Creating service"
    #TODO: Remove sc.exe dependence using reflection
    sc.exe create npf binPath= system32\drivers\npf.sys type= kernel start= auto error= normal tag= no DisplayName= "NetGroup Packet Filter Driver"
    
    Write-Verbose "Starting service"
    sc.exe start npf

}

function Remove-WinPCap 
{

      <#
        .SYNOPSIS
    
            Manually removes the WinPCAP libraries/driver
            Author: @sixdub

        .DESCRIPTION

            Requires admin. Removes all required files and deletes the service for the WinPCAP drivers. WinPCAP is licensed and copyrighted as follows:
            #Copyright (c) 1999 - 2005 NetGroup, Politecnico di Torino (Italy).
            #Copyright (c) 2005 - 2010 CACE Technologies, Davis (California).
            #All rights reserved.
            #For the full winpcap license, please see the repo

    #>
    [cmdletbinding()]
    Param()
    Write-Verbose "Checking if you are admin..."
    If (-NOT ([Security.Principal.WindowsPrincipal] [Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole(`
    [Security.Principal.WindowsBuiltInRole] “Administrator”))
    {
        Throw "This script requires administrator rights"
    }

    Write-Verbose "Stopping npf service"
    #TODO: Remove sc.exe dependency
    sc.exe stop npf
    Start-Sleep -s 2

    Write-Verbose "Deleting npf service"
    sc.exe delete npf
    $Arch = (Get-WmiObject Win32_OperatingSystem).OSArchitecture
    $SysPath =""
    if($arch -like "*64*")
    {
        Write-Verbose "Detected 64 bit system"
        if([IntPtr]::Size -eq 8)
        {
            Write-Verbose "Detected 64 bit PowerShell"
            $SysPath = "c:\windows\system32"
        }
        elseif([IntPtr]::Size -eq 4)
        {
            Write-Verbose "Detected 32 bit PowerShell"
            $SysPath = "c:\windows\sysnative"
        }
        else
        {
            Throw "Process arch detection is very broken"
        }
        
    }
    elseif($arch -like "*32*")
    {
        Write-Verbose "Detected 32 bit system (32 bit PowerShell too)"
        $SysPath = "c:\windows\system32"
    }
    else
    {
        Throw "Version detection problem"
    }

    Write-Verbose "Removing all files with System Path: $SysPath"
    $RemoveFiles = @("$SysPath\Packet.dll","$SysPath\wpcap.dll","$SysPath\Drivers\npf.sys")
    $RemoveFiles | %{
        Write-Verbose "Removing $_"
        Remove-Item -Force $_
    }

}

function Write-WinPCAPCapture
{

    <#
        .SYNOPSIS
    
            Writes a capture file to a specified location for a set time or size limit. 
            Author: @sixdub

        .DESCRIPTION

           Utilizes WinPCAP, Packet Dot Net, and SharpPCap to create a WinPCAP network capture on a selected interface with a certain filter. 

        .PARAMETER DevicePattern

           The pattern of the name of the device where you want to perform the capture Default = "*Local*"

        .PARAMETER Path

            The path to write the pcap file. Must not exist and must be a real path. 

        .PARAMETER Filter

            The BPF filter to apply. Default = ""

        .PARAMETER MaxSize
            
            The max size of the capture. Default = 1MB

        .PARAMETER CaptureTimeout

            A TimeSpan representing the max length a capture will run for. Default = 5 seconds

        .OUTPUTS
        
            FileInfo object pointing to capture file 

    #>
    [CmdletBinding()]
    Param(
    [Parameter(Mandatory=$False,Position=1)]
    [String]$DevicePattern = "*Local*",
    [Parameter(Mandatory=$True,Position=2)]
    [ValidateScript({$(Split-Path $_ | Test-Path) -and -Not $(Test-Path $_)})]
    [String]$Path,
    [Parameter(Mandatory=$False,Position=3)]
    [String]$Filter="",
    [Parameter(Mandatory=$False,Position=4)]
    [int]$MaxSize=1MB,
    [Parameter(Mandatory=$False,Position=5)]
    [System.TimeSpan]$CaptureTimeout=$(New-Timespan -Seconds 5)
    )

    #Check to ensure NPF is started and running


    #Required .NET assemblies
    #TODO: Add license and details for these assemblies
    $PacketDotNet_Assembly = ""
    $SharpPCap_Assembly = ""
    $PacketDotNet_Bytes = [System.Convert]::FromBase64String($PacketDotNet_Assembly)
    $SharpPCap_Bytes = [System.Convert]::FromBase64String($SharpPCap_Assembly)
    [System.Reflection.Assembly]::Load($PacketDotNet_Bytes) | Out-Null
    [System.Reflection.Assembly]::Load($SharpPCap_Bytes) | Out-Null

    #Update types to prevent crashing... thank you Joel Bennet http://poshcode.org/5374
    # To avoid crashing, you MUST avoid accessing the NonBlockingMode property
    # But I also want to expose the Interface.FriendlyName because it's the meaningful name
    Update-TypeData -TypeName SharpPcap.WinPcap.WinPcapDevice -MemberName FriendlyName -MemberType ScriptProperty -Value { $this.Interface.FriendlyName } 
    Update-TypeData -TypeName SharpPcap.WinPcap.WinPcapDevice -DefaultDisplayProperty FriendlyName -DefaultDisplayPropertySet FriendlyName, Addresses, Description, MacAddress  
    # The MacAddress property doesn't seem to work right now, but Interface.MacAddress does
    Update-TypeData -TypeName SharpPcap.WinPcap.WinPcapDevice -MemberName MacAddress -MemberType ScriptProperty -Value { $this.Interface.MacAddress } -Force
    # By default, PcapAddress ToString() shows the address and netmask etc. which we don't need to see all the time.
    #Update-TypeData -TypeName SharpPcap.LibPcap.PcapAddress -DefaultDisplayProperty Addr -MemberName ToString -MemberType ScriptMethod -Value { $this.Addr.ToString() } -Force 


    $Device = [SharpPcap.CaptureDeviceList]::Instance | ?{$_.FriendlyName -like $DevicePattern}

    Write-Verbose "Using Device `"$($Device.FriendlyName)`""
    $Pcap_Writer=  New-Object -TypeName SharpPcap.LibPcap.CaptureFileWriterDevice -ArgumentList ($Path)
    $Pcap_writer.Open()
    Write-Verbose "Opened Dump file `"$Path`""

    $Device.Open([SharpPcap.DeviceMode]::Promiscuous,1000);
    $Device.Filter = $Filter
    $StartTime = Get-Date
    Write-Verbose "Starting Capture at $StartTime"
    Write-Verbose "Capture will terminate at $($StartTime.Add($CaptureTimeout)) or at size $MaxSize"
    while($true)
    {
        if($packet = $Device.GetNextPacket())
        {
            $Pcap_Writer.Write($packet)
        
        }
        if ((Get-ChildItem $Path).length -gt $MaxSize)
        {
            Write-Verbose "Terminating Capture: Size Limit reached"
            break
        }
        if ((New-Timespan $StartTime $(Get-Date)) -gt $CaptureTimeout)
        {
            Write-Verbose "Terminating Capture: Time limit reached"
            break
        }
    }
    Write-Verbose "Stopping capture and closing device"
    $Device.StopCapture()
    $Device.Close()
    Write-Verbose "Stopping write and closing write device"
    $Pcap_Writer.StopCapture()
    $Pcap_Writer.Close()
    
	$OutFile = Get-ChildItem -path $Path 
	return $OutFile
}
